import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav className="w-full px-6 py-4 flex justify-between items-center border-b border-gray-200 bg-white shadow-sm font-sans">
      
      {/* Fiverr Logo */}
      <Link to="/" className="text-3xl font-extrabold text-gray-800 tracking-tight cursor-pointer">
        fiverr<span className="text-green-500">.</span>
      </Link>

      {/* Main Links */}
      <div className="hidden md:flex items-center gap-6 text-sm text-gray-700 font-medium">
        <div className="hover:text-black transition cursor-pointer">Fiverr Pro ‚ñæ</div>
        <div className="hover:text-black transition cursor-pointer">Explore ‚ñæ</div>
        <div className="hover:text-black transition cursor-pointer flex items-center gap-1">üåê EN</div>
        <div className="hover:text-black transition cursor-pointer">Become a Seller</div>
        <div className="hover:text-black transition cursor-pointer">
          Fiverr <span className="text-blue-700 font-bold">Go</span>
        </div>
        <Link to="/login" className="hover:text-black transition">Sign in</Link>
      </div>

      {/* Join Button */}
      <Link to="/register-client">
        <button className="px-5 py-1.5 border border-black text-sm font-semibold rounded hover:bg-gray-100 transition">
          Join
        </button>
      </Link>
    </nav>
  );
}

export default Navbar;
